Answer: You can add a condition to check if the man has stopped moving, and if so, set the opacity of the screen to 0 to hide it. Here's an example of how you can modify your `move` function to achieve this:
```javascript
function move() {
    x += dx;
    y += dy;
    if (x < 0 || x > screenWidth - 20) {
        dx = -dx;
    }
    if (y < 0 || y > screenHeight - 20) {
        dy = -dy;
    }
    screen.style.left = x + "px";
    screen.style.top = y + "px";
    screen.style.width = screenWidth + "px";
    screen.style.height = screenHeight + "px";
    screen.style.opacity = "1";

    // Check if the man has stopped moving
    if (Math.abs(dx) + Math.abs(dy) < 0.01) {
        // Hide the screen
        screen.style.opacity = "0";
    }

    setTimeout(move, speed * 1000);
}
